import React, { Component } from "react";

class Welcome extends Component {
  render() {
    return (
      <div className="text-center">
        <img src="https://photos.google.com/album/AF1QipN6m7olZZ6c6Qpxp2soDXR7NLqM6_B62yuLx_fO/photo/AF1QipMIkhs788hIkcZgMc7VA9YlJ46t5OopxgYL4OAU" className="img-responsive" />
        <h2>Welcome</h2>
      </div>
    );
  }
}

export default Welcome;
